import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png";

function navbar() {
    return (
        <div className="navBar">
            <img className="logo-navbar" src= {logo} alt="Comarca de creadores logo" />
            <div>
                <ul>
                    <li>
                        <a href="#">Productos</a>
                    </li>
                    <li>
                        <a href="#">Nosotros</a>
                    </li>
                    <li>
                        <button><span id="contadorCarrito">0</span><i class="fas fa-shopping-cart"></i></button>
                    </li>
                </ul>
            </div>



        </div>
    );
};

export default navbar;
